import React, { Component } from 'react'
import { useState } from 'react';
import PackageInfoForm from '../components/UserDashboard/PackageInfoform';
import WhereFromForm from '../components/wherefromform'
import WhereToForm from '../components/wheretoform';
import PaymentForm from '../components/UserDashboard/Payment';
import StepsHeader from '../components/stepsHeader';
import { render } from 'react-dom';

export default class CreateGuidePagina extends Component {

  constructor(props) {
    super(props)

    this.state = {
      step: 1
    }

    this.nextStep = this.nextStep.bind(this)

  }

  nextStep() {
    this.setState({
      step: this.state.step + 1
    }, () => { console.log("CallBack Value", this.state.step) })
  }

  render() {

    <React.Fragment>

    </React.Fragment>
    switch (this.state.step) {
      case 1:
        return (
          <div>
            <Navbar />
            <img src="/images/image1.jpeg" style={{ width: '100%', padding: 0, }}></img>
            <StepsHeader step={this.state.step} />
            <WhereFromForm stepHandler={this.nextStep} />
          </div>
        );

      case 2:
        return (
          <div>
            <Navbar />
            <img src="/images/image1.jpeg" style={{ width: '100%', padding: 0, }}></img>
            <StepsHeader step={this.state.step}/>
            <WhereToForm stepHandler={this.nextStep}/>
          </div>
        );

      case 3:
        return (
          <div>
            <Navbar />
            <img src="/images/image1.jpeg" style={{ width: '100%', padding: 0, }}></img>
            <StepsHeader step={this.state.step}/>
            <PackageInfoForm stepHandler={this.nextStep} />
          </div>
        );

      case 4:
        return (
          <div>
            <Navbar />
            <img src="/images/image1.jpeg" style={{ width: '100%', padding: 0, }}></img>
            <StepsHeader step={this.state.step} />
            <PaymentForm />
          </div>
        );
      }
    }
  }
